import React from "react";
import { NavLink, Link } from "react-router-dom";

class Header extends React.Component{
    render() {
        return(
            <div class = "container">
                <header class="header" id="header">
                    <div id="logo"><NavLink to={"/"}><img src="https://brave-pebble-0432f1103.2.azurestaticapps.net/src/WorldofBoardGames.com.png" /></NavLink></div>
                    <div id="quick_link">
                        <a target="_blank" href = "https://www.google.com/maps/place/Worldofboardgames.com/@63.8482097,20.3114261,15z/data=!4m2!3m1!1s0x0:0xc047bbd27173880b?sa=X&ved=2ahUKEwjF4LnVm6T9AhXL6CoKHWpSAYYQ_BJ6BAhxEAg"><i class="map"><img src="https://cdn-icons-png.flaticon.com/512/5767/5767387.png" alt="hitta till butiken" /></i></a>
                        <NavLink to = "/login" activeClassName="active"><i class="knight"><img src="https://cdn-icons-png.flaticon.com/512/3819/3819346.png" alt="logga in eller skapa konto" /></i></NavLink>
                        <a href = "URL"><i class="cart"><img src="https://cdn-icons-png.flaticon.com/512/833/833314.png" alt="din kundvagn" /></i></a>
                        <a href="#footer"><i class="down"><img src="https://cdn-icons-png.flaticon.com/512/2985/2985149.png" alt="button to footer" /></i></a>
                    </div>
                </header>
                <nav class="menu" id="myMenu">
                    <NavLink to ="/" exact activeClassName="active">Hem</NavLink>
                    <NavLink to="/products" activeClassName="active">Alla Spel</NavLink>
                    <NavLink to="/categories" activeClassName="active">Kategorier</NavLink>
                    <NavLink to="/forum" activeClassName="active">Forum</NavLink>
                    <a onclick="random_hex()">Rave</a>
                    <div class="search"><input type="text" name="search" placeholder="SÃ¶k" /></div>

                    <div class="icon" id="menu_btn" onclick="topnav_resp()">
                        <div class="bar" id="bar1"></div>
                        <div class="bar" id="bar2"></div>
                        <div class="bar" id="bar3"></div>
                    </div>
                </nav>
            </div>
        );
    }
}
export default Header;
